import React from "react";

class Student extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "John",
            tel: "0893983947"
        }
    }

    render(){
        
        return(
            <div>
                <h2>Student Class Component</h2>
                <div>Name: {this.state.name}</div>
                <div>Tel: {this.state.tel}</div>
            </div>
        )
    }
}

export default Student;
